import './App.css';
import skincareWomanImage from './skincare_woman.jpeg';
import { Link } from 'react-router-dom';

function Navigation() {
  return (
    <div className='m-16  border-2 border-black rounded-xl'>
        <div className='flex justify-between'>
            <Link to="/">
            <button className='p-4 mx-32'>
                Skincarify
            </button>
            </Link>
            <Link to="/camera">
            <button className='p-4 mx-32'>
                Camera
            </button>
            </Link>
        </div>
    </div>
  );
}

export default Navigation;
